import React, {useEffect, useState} from 'react';
import { DataGrid } from '@mui/x-data-grid';
import axios from 'axios';

function DataGridForEvents() {
  const [data, setData] = useState([]);

  const getEventsData = async () => {
    try {
      // Replace this URL with the URL of the API you want to use
      const response = await axios.get("https://api.example.com/data");
      setData(response.data);
    } catch (error) {
      console.error("Error fetching data:", error);
    }
  };

  useEffect(() => {
    getEventsData();
  }, []);

  const columns = [
    { field: "id", headerName: "ID", width:90 },
    { field: "eventname", headerName: "Event Name", width:150 },
    { field: "type", headerName: "Event Type", width:90 },
    { field: "action", headerName: "Action", width:90 }

  ];


  console.log(data);

  return (
    <div>DataGrid</div>
  );
}

